import React from "react";
import { homedata } from "../../dummydata";
import Home from "./Home";

export const Homes = () =>{
    const [items,setitems] = useState(homedata)
    return(
        <>
        <section className="Home">
         <Home items={items}/>
        </section>
        <div className="margin"></div>
        </>
    )
}
